import DivHomeStyled from "../../Styles/DivHome";
import Button from "../Button";
import bin from "../../Assets/bin.svg";
import axios from "axios";
import { useEffect, useContext } from "react";
import CardTech from "../CardTech";
import { TechContext } from "../../Context/TechContext";
import { UserContext } from "../../Context/UserContext";

const MainHome = async ({ setModal, techArray, setTechArray }) => {
  console.log(techArray);
  const { handleDeleteClick } = useContext(TechContext);
  const { UserData } = useContext(UserContext);
  const TechsUserData = UserData.techs;

  return (
    <DivHomeStyled>
      <div className="headerTech">
        <p className="tech">Tecnologias</p>
        <Button className="addButton" onClick={() => setModal(true)}>
          +
        </Button>
      </div>
      <div className="containerList">
        {setTimeout(
          TechsUserData.map((obj) => {
            return <CardTech handleDeleteClick={handleDeleteClick} obj={obj} />;
          }),
          4000
        )}
      </div>
    </DivHomeStyled>
  );
};
export default MainHome;
